import React, { useEffect, useState } from 'react'
import axiosInstance from '../../baseurl'

function ViewDocChat({chatid}) {
    const [chat,setchat] = useState([])
    console.log(chatid);
    useEffect(()=>{
        axiosInstance.post(`/viewChatForDrwithCust`, {cid:chatid, drid:localStorage.getItem('Doctorlogid')})
        .then((res)=>{console.log(res, 'all chat with customer by id')
        setchat(res.data.data)
    })
        .catch((err)=>{console.log(err);})
    },[chatid])
  return (
    <div className="container container-top" >
    <div className='container text-center'>
        <div className='row'>
          {chat.length?chat.map((a)=>{
            return (
                <div className='col'>
                <div class="card" >
                    <div class="card-body">
                        <h5 class="card-title">{a.name}</h5>
                        <p class="card-text">specialization : {a.specialization}</p>
                        <p class="card-text">Contact : {a.contact}</p>

                        <Link to={`/cusprofile/createChat/Chat/${a._id}`} class="btn btn-primary">Chat</Link>
                    </div>
                    </div>
                </div>
            )
          }): <div className='col'>
          <div class="card" style={{width: "18rem"}}>
              
              <div class="card-body">
                  <h5 class="card-title"> No Doctors available</h5>
                  
              </div>
              </div>
          </div>}
        </div>
    </div>
</div>
  )
}

export default ViewDocChat
